<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">
<html lang="en">
<head>
  <title>Secondary Navigator</title>
  <base href>
  <!-- BEGIN CUSTOMIZATION -->
  <link type="text/css" rel="STYLESHEET" href="../AMSCSS/default/ADVSecondaryNavigator.css">
  <!-- END CUSTOMIZATION -->
  <link type="text/css" rel="STYLESHEET" href="../AMSImages/ADVMenuStyle.css">
  <script type="text/javascript" language="JavaScript" vsscript="true"></script>
  <script type="text/javascript" language="JavaScript" src="../AMSJS/AMSDHTMLLib.js"></script>
  <script type="text/javascript" language="JavaScript" src="../AMSJS/AMSMenu.js"></script>
  <script type="text/javascript" language="JavaScript" src="../AMSJS/AMSMenuArray.js"></script>
  <script type="text/javascript" language="JavaScript" src="../AMSJS/AMSUtils.js"></script>
</head>

<body class="adv secnav">

  <form action="Advantage" method="post" vsform="true" name="SecondaryNavigator">
    <!-- BEGIN CUSTOMIZATION -->
    <div id="DocumentFlags" name="DocumentFlags">
      <input type="hidden" value="" name="PanelState" ></input>
    </div>
    <!-- END CUSTOMIZATION -->
    <div name="AppNavPanel" id="AppNavPanel" title="Application Navigation Panel" class="advappnav">
      <iframe name="AppNav" id="AppNav" title="Application Navigator" longdesc="../AMSImages/FrameDesc.htm#AppNav" scrolling="auto" frameborder="0" marginwidth="0" marginheight="0" src="../AMSImages/portal.htm" class="appnavframe"></iframe>
    </div>
    <div name="BFNavPanel" id="BFNavPanel" title="Workspace Navigation Panel" class="advbfnav">
      <iframe name="BFNav" id="BFNav" title="Workspace Navigator" longdesc="../AMSImages/FrameDesc.htm#BFNav" scrolling="auto" frameborder="0" marginwidth="0" marginheight="0" src="../AMSImages/portal.htm" class="bfnavframe"></iframe>
    </div>
    <div name="DocNavPanel" id="DocNavPanel" title="Document and Multi-Table Navigation Panel" class="advdocnav">
      <iframe name="DocNav" id="DocNav" title="Document and Multi-Table Navigation Panel" longdesc="../AMSImages/FrameDesc.htm#DocNav" scrolling="auto" frameborder="0" marginwidth="0" marginheight="0" src="../AMSImages/portal.htm" class="docnavframe"></iframe>
    </div>
    <div style="visibility:hidden;display:none;">
      <a href="Advantage" target="AppNav" name="ADVAppNavTrans" id="ADVAppNavTrans" title="Application Navigator (Internal)" vsaction="1" vsds=" " ams_destination="AppNavPanel" ams_applname="Advantage"></a>
    </div>
 <!-- BEGIN CUSTOMIZATION -->
 <div id="SecondaryNavigatorExpandCollapseBar" class="bar">
   <div class="arrowleft">
     <a href="#Collapse/Expand" id="SecondaryFrameExpandCollapse" name="SecondaryFrameExpandCollapse" title="Collpase/Expand Frame" class="expanded"></a>
   </div>
 </div>
  <!-- END CUSTOMIZATION -->
 </form>

</body>
</html>
